import Header from "./components/Header";
import Navigation from "./components/Navigation";
import Presenting from "./components/Presenting";
import Topbar from "./components/Topbar";

const App = () => {
  return (
    <div className="App">
      <Header />
      <Navigation />
      <Topbar />
      <Presenting />
    </div>
  );
}

export default App;
